import React from 'react';
import './About.css';


function About() {
  return (
    <div className='About'>
     <div>
      <button>About Bernard</button>
      <button>Experience</button>
      <button>Freelance</button>
      <button>Coding</button>
      <button>Contact</button>
     </div>

     <div>
       <h4>Experience</h4>
       <ul>
        <li>News editor, Daily Bruin</li>
        <li>Contributor, CalMatters</li>
        <li>Data Journalist, The Stack</li>
        <li>Staff reporter, Daily Bruin</li>
       </ul>
     </div>
    </div>
  );
}

export default About;
